import { useEffect, useState } from 'react';
import './App.css';
import Header from './components/header'; 

export default function App() {

  const [backendData, setBackendData] = useState([{}])

  useEffect(() => {
    fetch('/server')
      .then(res => res.json())
      .then(data => {
        setBackendData(data);
      })
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  return (
    <Header />
  );
}
